parameters.jsCode:
const items = $input.all();

const allKeywords = items.flatMap(item => {
  const output = item?.json?.output;
  if (!output) {
    return [];
  }
  return [
    ...(output.VideoTags || [])
  ];
});

const keywordList = allKeywords.filter(keyword => keyword).join(', ');

return [{ json: { youtubeKeywords: keywordList } }];

